La giornata tipo del arrampicatore. 
1) Avvicinamento con frigo da muratore e parolacce per gli inciampi;

2) Vestizione con sciarpa e cuffia alla moda, della tua consorte;

3) Sconforto per non aver portato le lasagne;

4) Momento di goliardia;

5) Finalmente si va su gradi alti, che potrebbero attestarsi sui 4C/5B;

